		<meta http-equiv="Content-Type" content="text/html; charset=utf-8"/>
		<title>Error 503: server unavailable</title>
		<style type="text/css">
			* {
				font-family: "Trebuchet MS", "Arial", "Lucida grande", "Bitstream Charter", "Liberation sans", "FreeSans", sans-serif;
				font-size: 16px;
				line-height: 20px;
				color: #494949;
				padding: 0;
				margin: 0;
				font-size: normal;
				font-weight: 200;
			}
			body { background-color: #F1F1F1; padding-top: 95px; }
			.container { padding: 0; margin: 0 auto; max-width: 737px; text-align: center; }
			.block { display: block; }
			.blue { color: #3267BF; }
			.regular { font-weight: 400; }
			.fs30 { font-size: 30px; line-height: 30px; }
			.fs40 { font-size: 40px; line-height: 40px; }
			.fs50 { font-size: 50px; line-height: 50px; }
			.lh45 { line-height: 45px; }
		</style>
	</head>

	<body>
		<div class="container">
			<span class="fs50">Error <span class="fs50 regular blue">503:</span> Backend unavailable</span>
			<br/><br/>
			This type of error usually results of an unavailability of servers behind IP Load Balancing.
			<br/><br/><br/><br/>
			<img src="data:image/png;base64," style="width: 100%; max-height: 141px;" />
			<img src="data:image/png;base64," style="margin-top: 10px; width: 100%; max-height: 47px;" />
			<br/><br/><br/><br/>
			If you are a visitor of the website, please try to refresh it or come back in a few minutes.
			<br/>
			If you are the administrator of the website, please check the configuration of your server and/or IP LoadBalancing configuration.
			<br/><br/>
			<span class="fs30 blue">In case the problem persists, please <a href="http://www.ovh.com/" class="fs30 blue regular">contact us</a>.</span>
			<br/>
			<a href="https://www.ovh.com/manager/sunrise/iplb/index.html#/iplb" style="text-decoration: none; display: block; margin-top: 5px;">
				<img src="data:image/png;base64," style="margin: 0 0 -16px 5px;" />
			</a>
		</div>
	</body>
</html>

